import React from 'react'

export const BuyBudgetFlat = (props) => {

    const budget_flats=()=>{
        history.push({
            pathname:"./propertylist",
            state:{
                reason:"Buyer/Owner",
                city:props.city,
                flat:"Flat/ Apartment",
                maxbudget:5000000,
                minbudget:100000
            }     

        })    }

    return (
   <div className="drop-links">
        <li><a href="" onClick={budget_flats}>Under 50lac</a></li>

    </div>
    )
}
